import React, { Component } from 'react'

export default class Favbeach extends Component {

    render() {



        return (
            <div>
                <div>
                <img key={this.props.beach.id} 
                    src={this.props.beach.photo_1} 
                    alt="beach">
                </img>
               Beach Display{this.props.beach.name}
               </div>
               <button>Create a Review</button>
            </div>
           )    
    }
}
